import React from 'react'
import { render } from 'react-dom'
import { BrowserRouter } from 'react-router-dom'
import App from './components/navbar/App';

import './index.css'

const colorStyle={
	backgroundColor: red,
color: black,}



    render((
  <BrowserRouter style={colorStyle}>
    <App />
  </BrowserRouter>
), document.getElementById('root'));
